import { BrowserRouter as Router, Route } from "react-router-dom";
import Login from "./components/login";
import Reports from "./components/reports";


function App() {
  return (
    <Router>
    <div>
      <Route exact path="/">
        <Login />
      </Route>
      <Route path="/news">
        <Reports/>
      </Route>
    </div>
  </Router>
  );
}

export default App;
